import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to appear (try by class)
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open the Product Detail Modal
    const productCard = await page.$('.product-card');
    await productCard.click();

    // Wait for the modal to appear (by id)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for the modal to be visible (modal-content inside #productModal)
    await page.waitForSelector('#productModal .modal-content', { timeout: 5000 });

    // Take screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal_open.png'));

    // Extract product title from the modal
    const modalTitle = await page.$eval(
      '#productModal .product-detail-title',
      el => el.textContent.trim()
    );

    // Extract price from the modal
    const modalPrice = await page.$eval(
      '#productModal .product-detail-price',
      el => el.textContent.replace(/\s+/g, ' ').trim()
    );

    return {
      success: true,
      action: "Opened Product Detail Modal and extracted product title and price",
      extractedData: {
        modalTitle,
        modalPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
